const e=JSON.parse('{"key":"v-4c4699af","path":"/software-guide/vpn/cfw_setting.html","title":"CFW配置","lang":"zh-CN","frontmatter":{"icon":"edit","category":["科学上网","CFW"],"tag":["vpn","机场","配置"]},"headers":[{"level":2,"title":"配置文件模板","slug":"配置文件模板","link":"#配置文件模板","children":[{"level":3,"title":"关键修改","slug":"关键修改","link":"#关键修改","children":[]}]},{"level":2,"title":"配置文件改进","slug":"配置文件改进","link":"#配置文件改进","children":[]}],"git":{"createdTime":1692862199000,"updatedTime":1692862199000,"contributors":[{"name":"csxwant","email":"csxwant@gmail.com","commits":1}]},"readingTime":{"minutes":4.31,"words":1293},"filePathRelative":"software-guide/vpn/cfw_setting.md","localizedDate":"2023年8月24日","excerpt":"<h1> CFW配置</h1>\\n<p>这篇文章将讲述如何对Clash For Windows进行配置，以帮助你更好的使用。</p>\\n<p>CFW默认的代理模式有四种，分别为:<br>\\n规则: 代表规则模式，属于国内直连，国外自动走节点流量（建议使用）<br>\\n全局: 代表全局模式，全部国内国外都走节点流量（有可能导致访问国内比较卡）<br>\\n直连: 代表直连模式，全部国内国外走不走节点流量（相当于没开clash）<br>\\n脚本: 配置比较复杂非专业人士不建议用</p>\\n<p>但当你使用机场的配置文件时，你使用的规则都是由机场服务提供的，这也注定在某些地方\\n不能满足你的需求，所以我们可以自己定义配置文件。</p>"}');export{e as data};
